import React from "react";
import DisplayUser from "./DisplayUser";
const ShowUser=(props)=>{
   const list=[...props.users];

    

    
return <div >
    <body></body>
   {
    list.map(i=>(
        <DisplayUser key={i.id} name={i.name} age={(i.age)}></DisplayUser>
    ))
   }
    
 
     </div>






}
export default ShowUser;
